const Footer = () => {
    return(
    <footer className="footer mt-auto py-3 bg-dark">
         <div className="container">
         <p className="text-light"><strong><a href="https://github.com/brunamota/trabalhoDAW" target="_blank" rel="noreferrer">Job Pool</a></strong></p>
         <p className="text-light">Website desenvolvido por Bruna Mota Barbosa, Lígia Gouveia Silva, Leonardo Rocha Freitas</p>
         <p className="text-light"><small><strong>Desenvolvimento de Aplicações WEB</strong><br/>
      Universidade Federal de Jataí</small></p>
  </div>
</footer>
    );
}

export default Footer;
